import axios from "axios";
import React, { useState } from "react";


const Search = () => {

    const[id,setId] = useState()

    const getData = async(e) => {
        e.preventDefault()
        const resp = await axios.get(`https://63610b45af66cc87dc21409b.mockapi.io/property_data/${id}`)
        let data = resp.data
        console.log(data)
    }

    return (
        <>
            <form>
                <table>
                    <tr>
                        <input type="text" onChange={setId} placeholder="Enter ID to Search" />
                    </tr>
                    <tr>
                        <button onClick={()=>getData}>Search</button>
                    </tr>
                </table>
            </form>
        </>
    )
}

export default Search;
